function playSound(dataURI) {
    return new Promise(function(resolve, reject) {
        var snd = new Audio(dataURI);
        snd.onended = resolve;
        snd.play();
    });    
}

function beep() {
    return playSound("data:audio/wav;base64,");  
}

function repeatNoise() {
    // powerUp3
    return playSound("data:audio/mpeg;base64,");
}

function finishedNoise(){
    // zap2Tone2
    return playSound("data:audio/mpeg;base64,");
}

function switchNoise() {
    // spaceTrash3
    return playSound("data:audio/mpeg;base64,");
}

function halfwayNoise() {
    // phaseDown1
    return playSound("data:audio/mpeg;base64,");
}

function repeat(count, seconds, options) {
    return new Promise(async function(resolve, reject) {
        if (count <= 0) {
            console.log('Next Exercise');
            await finishedNoise();
            resolve();
            return;
        }

        if (options.timeHook) {
            await options.timeHook(count);    
        }    

        console.log('Reset');
        window.setTimeout(async function() {
            await tick(seconds);
            await repeat(count - 1, seconds, options);
            resolve();
        }, 1000);    
    })    

}

function tick(seconds) {
    return new Promise(function(resolve, reject) {
        var count = 0;
        beep();
        console.log('Hold Movement');
        var interval = window.setInterval(async function() {
            count++;
            if (count >= seconds) {
                window.clearInterval(interval);
                await repeatNoise();
                resolve();
            } else {
                beep();
            }
        }, 1000)     
    })
       
}

var button = document.createElement('button');
button.innerHTML = "Start Exercise"
button.onclick = async function() {

    // Hamstring Stretch
    // 6 reps, 10 seconds each
    // Play noise at half way point (3)
    await repeat(6, 10, {
        timeHook: async function(set) {
            if (set === 3) {
                await halfwayNoise();
            }
        }
    });

    await switchNoise();

    // Hamstring Curl
    // 6 reps, 8 seconds each
    // Play noise at half way point (3)
    await repeat(6, 8, {
        timeHook: async function(set) {
            if (set === 3) {
                await halfwayNoise();
            }
        }
    }); 

    await switchNoise();

    // Squats
    // 15 reps, 5 seconds each
    await repeat(15, 5);

    await switchNoise();

};

document.body.innerHTML = "";
document.body.appendChild(button);
